import React from 'react';
import PropTypes from 'prop-types';

const BillToPart = ({ clientAddressHandler, clientAddress, partSeparator }) => (
  <partSeparator numberPerLine="three">
    <div className="container">
      <label htmlFor="postCode">
        <p className="label">Post Code</p>
        <input
          type="text"
          value={clientAddress.postCode}
          onChange={(e) => clientAddressHandler({ ...clientAddress, postCode: e.target.value })}
        />
      </label>
    </div>
  </partSeparator>
);

BillToPart.propTypes = {
  clientAddressHandler: PropTypes.func.isRequired,
  clientAddress: PropTypes.shape({
    street: PropTypes.string,
    city: PropTypes.string,
    postCode: PropTypes.string,
    country: PropTypes.string,
  }).isRequired,
  partSeparator: PropTypes.element.isRequired,
};

export default BillToPart;
